UPDATE usr_figures 
SET NumSocPub = T.NumSocPub
FROM (
    SELECT PublisherCod,COUNT(*) AS NumSocPub FROM social_pubs GROUP BY PublisherCod) AS T
WHERE 
    usr_figures.UsrCod = T.PublisherCod;


